import * as React from 'react';
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import { styled } from '@mui/material/styles';
import { useParams , useState, useEffect} from 'react-router-dom';



const Details = () => {
  const { id } = useParams();

  const {searchRes, setSearchRes} = useState();
  useEffect(() => {
    fetch(`http://localhost:8080/search/${id}`)
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setSearchRes(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    flexGrow: 1,
  }));
  
  // Access the `id` parameter and use it in your component

  return (
    <Stack spacing={{ xs: 1, sm: 2 }} direction="row" useFlexGap flexWrap="wrap">
  <Item>Id : {id}</Item>
  <Item >{searchRes}</Item>
  <Item>Long content</Item>
</Stack>
  );
};

export default Details;
